import { Injectable } from '@angular/core';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';

(pdfMake as any).vfs = pdfFonts.vfs;

const LOGO_JIREH_BASE64 =
  '';
const COLOR_DESCUENTO = '#115202'; // verde oscuro
const COLOR_TOTAL = '#0B3C5D'; // azul oscuro

@Injectable({
  providedIn: 'root',
})
export class PdfService {
  constructor() {}

  downloadVenta(data: any) {
    
    const h = data.encabezado;
    const detalle = Array.isArray(data.detalle) ? data.detalle : [];
    const resumen = data.resumen ?? { items: detalle.length, subtotal: 0 };

    const isDescuento = (Number(resumen?.subtotal) || 0) >= 300;
    const descuento = isDescuento ? (Number(resumen?.subtotal) || 0) * 0.1 : 0;
    const totalFinal = (Number(resumen?.subtotal) || 0) - descuento;

    const money = (n: any) =>
      (Number(n) || 0).toLocaleString('es-GT', {
        minimumFractionDigits: 2,
        maximumFractionDigits: 2,
      });

    const body = [
      // Header tabla
      [
        { text: 'Cdigo', bold: true },
        { text: 'Descripcin', bold: true },
        { text: 'Cant.', bold: true, alignment: 'right' },
        { text: 'P.U', bold: true, alignment: 'right' },
        { text: 'Total', bold: true, alignment: 'right' },
      ],
      // Rows
      ...detalle.map((r: any) => [
        r.cod_articulo ?? '',
        r.descripcion ?? '',
        { text: String(r.cantidad ?? 0), alignment: 'right' },
        { text: money(r.precio), alignment: 'right' },
        { text: money(r.total), alignment: 'right' },
      ]),
    ];

    // Si no hay detalle, al menos una fila
    if (detalle.length === 0) {
      body.push([
        { text: 'Sin detalle', colSpan: 5, italics: true, color: '#666' },
        {},
        {},
        {},
        {},
      ]);
    }

    const docDefinition: any = {
      pageSize: 'LETTER',
      pageMargins: [30, 95, 30, 50],
      images: {
        logo: `data:image/png;base64,${LOGO_JIREH_BASE64}`,
      },
      header: {
        margin: [30, 20, 30, 0],
        stack: [
          {
            columns: [
              { image: 'logo', width: 60 },
              {
                stack: [
                  { text: 'LIBRERIA JIREH', fontSize: 14, bold: true },
                  {
                    text: 'Comprobante de Cotizacin',
                    fontSize: 9,
                    color: '#555',
                  },
                ],
                margin: [10, 6, 0, 0],
              },
              {
                text: `No. ${h?.id_operacion ?? ''}`,
                alignment: 'right',
                bold: true,
                fontSize: 12,
              },
            ],
          },
          //  AQU S SE PUEDE
          {
            canvas: [
              {
                type: 'line',
                x1: 0,
                y1: 5,
                x2: 515,
                y2: 5,
                lineWidth: 1,
                lineColor: '#cccccc',
              },
            ],
          },
        ],
      },

      footer: (currentPage: number, pageCount: number) => ({
        margin: [30, 0, 30, 20],
        columns: [
          {
            text: `Generado: ${new Date().toLocaleString('es-GT')}`,
            fontSize: 8,
            color: '#666',
          },
          {
            text: `Pgina ${currentPage} de ${pageCount}`,
            alignment: 'right',
            fontSize: 8,
            color: '#666',
          },
        ],
      }),

      content: [
        // Datos cliente
        {
          columns: [
            [
              {
                text: `Cliente: ${h?.cod_cliente ?? ''} - ${h?.nombre ?? ''}`,
                fontSize: 10,
              },
              {
                text: `Direccin: ${h?.direccion ?? ''}`,
                fontSize: 10,
              },
              {
                text: `Telfono: ${h?.telefono ?? ''}`,
                fontSize: 10,
              },
            ],
            [
              {
                text: `Fecha: ${h?.fecha ?? ''}`,
                alignment: 'right',
                fontSize: 10,
              },
            ],
          ],
          margin: [0, 25, 0, 12],
        },

        // Tabla detalle
        {
          table: {
            headerRows: 1,
            widths: [70, '*', 45, 55, 60],
            body,
          },
          layout: 'lightHorizontalLines',
          fontSize: 9,
          margin: [0, 0, 0, 12],
        },

        // Totales
        {
          columns: [
            { text: '' },
            {
              width: 220,
              table: {
                widths: ['*', 80],
                body: [
                  [
                    { text: 'Items', bold: true },
                    {
                      text: String(resumen.items ?? detalle.length),
                      alignment: 'right',
                    },
                  ],
                  [
                    { text: 'Subtotal', bold: true },
                    { text: money(resumen.subtotal), alignment: 'right' },
                  ],
                  [
                    {
                      text: `Descuento (${isDescuento ? '10%' : '0%'})`,
                      bold: true,
                      color: '#115202',
                    },
                    {
                      text: money(descuento),
                      alignment: 'right',
                      color: '#115202',
                    },
                  ],
                  [
                    {
                      text: 'TOTAL',
                      bold: true,
                      fontSize: 11,
                      color: '#0B3C5D',
                    },
                    {
                      text: money(totalFinal),
                      alignment: 'right',
                      bold: true,
                      fontSize: 11,
                      color: '#0B3C5D',
                    },
                  ],
                ],
              },
              layout: 'noBorders',
            },
          ],
        },
      ],
    };

    pdfMake
      .createPdf(docDefinition)
      .download(`venta_${h?.id_operacion ?? 'sin_id'}.pdf`);
  }
}
